import React from 'react';
import MenuIcon from '@material-ui/icons/Menu';
import { AppBar, Toolbar, Button, IconButton, Typography, makeStyles, createMuiTheme, Box, InputBase } from '@material-ui/core';
import SearchIcon from '@material-ui/icons/Search';
import { palette } from '@material-ui/system'

const theme = createMuiTheme();

const useStyles = makeStyles({
    title: {
        margin: theme.spacing(2)
    }
})

const Header = () => {
    const classes = useStyles;
    return(
        <>
            <AppBar display='flex' position='static'>
                <Toolbar>
                    <IconButton edge='start'>
                        <MenuIcon/>
                    </IconButton>
                    <Box ml={2} mr={2}>
                        <Typography className={classes.title} variant='h6'> My CookBook </Typography>
                    </Box>
                    <Typography edge='end'>
                        <Box bgcolor={primary.main} pt={1}>
                            <SearchIcon/>
                            <InputBase placeholder='Search...abs'/>
                        </Box>
                    </Typography>
                </Toolbar>
            </AppBar>
        </>
    )
}

export default Header;
